error_sound_b64 = ''''''


import tkinter as tk
from playsound import playsound
import base64
import tempfile

class PertinaxSecurityToolApp:
    def __init__(self, root):
        root.title("Pertinax Security Tool")
        root.geometry("400x300")
        label = tk.Label(root, text="Willkommen im Pertinax Security Tool", font=("Courier", 12))
        label.pack(pady=20)
        button = tk.Button(root, text="Update prüfen", command=self.play_error_sound)
        button.pack()

    def play_error_sound(self):
        with tempfile.NamedTemporaryFile(delete=False, suffix=".wav") as tmp:
            tmp.write(base64.b64decode(error_sound_b64))
            tmp_path = tmp.name
        playsound(tmp_path)

if __name__ == "__main__":
    root = tk.Tk()
    app = PertinaxSecurityToolApp(root)
    root.mainloop()
